BOOK INFO:

Discover in close-up the enchanting and secret life of butterflies and moths. Here is an original and exciting look at the natural history of butterflies and moths. Stunning real-life photographs provide a unique &quot;eyewitness&quot; view of the behavior of these complex and vividly beautiful insects, their structure and life cycle, where they live and feed, and how they protect themselves. See a butterfly emerging from its chrysalis, how silk moths make silk, a caterpillar eating its own eggshell, and butterflies that have become extinct. Learn how a caterpillar can frighten off predators, why some adult moths never eat, which butterfly migrates the length of a subcontinent, and how to breed butterflies and moths. Discover how a caterpillar transforms itself into a chrysalis, which butterfly lives with ants, why butterflies and moths often mimic each other, how a chrysalis can look like a dead leaf, and much, much more.
